import React from 'react'
import Fragment from 'render-fragment';

export default class FixedRoster extends React.Component {

    render() {

        const renObjData = this.props.userCourses.map(function(data, idx) {
            return ([
                <p key={idx}>{data.title}</p>,
                <p key={idx}>{data.startTime}</p>,
            ]);
        });

        return(
            <Fragment>
                {renObjData}
            </Fragment>

        )
    }
}
